const LoginRes = ({loginCnt, loginStatus}) =>{
    const logInRes = () => {
        if(loginCnt === 0){
            return;
        }else if(!loginStatus){
            return(
                <span style={{fontSize:"0.8rem", color:"red"}}>
                    아이디나 비밀번호가 정확하지 않습니다!
                </span>
            )
        }
    }

    return (
        {logInRes}
    );
}

export default LoginRes;
